/* eslint-disable no-unused-vars */
import React from 'react';
import Navbar from './Navbar';
import Carousel from './Carousel';
import Services from './Services';
import Calculator from './Calculator';
import Enquiry from './Enquiry';
import {Switch,Route,Redirect} from 'react-router-dom';
import Footer from './Footer';

import Contact from './pages/Contact';
import Personal from './pages/Personal';
import Business from './pages/Business';
import Property from './pages/Property';
import Car from './pages/Car';
import Discounting from './pages/Discounting';
import Capital from './pages/Capital';
import Overdraft from './pages/Overdraft';
import Term from './pages/Term';
import Vechicle from './pages/Vechicle';
import Equipment from './pages/Equipment';
import Credit from './pages/Credit';
import Bill from './pages/Bill';
import Factoring from './pages/Factoring';
import Bank from './pages/Bank';
import Ipo from './pages/Ipo';
import Private from './pages/Private';
import Quasi from './pages/Quasi';
import Promoter from './pages/Promoter';
import Shares from './pages/Shares';
import Project from './pages/Project';
import Infras from './pages/Infras';
import Contruction from './pages/Contruction';
import Agriculture from './pages/Agriculture';
import Homeloan from './pages/Homeloan';

function App() {
  return (
    <>
    <Navbar/>
    <Calculator/>
    <Enquiry/>
    <Switch>
      <Route exact path='/' component={Carousel}></Route>
      {/* <Route exact path='/' component={Carouselslide}></Route> */}
      <Route exact path='/services' component={Services}></Route>
      <Route exact path='/contact' component={Contact}></Route>

    </Switch>
    <Footer/>
    </>
  );
}

export default App;
